INSERT INTO `catalogsearch_fulltext` (`fulltext_id`, `product_id`, `store_id`, `data_index`) VALUES
(89, 22, 1, 'test20|None|Wilson NFL Performance Official Football|Preferred by quarterbacks for its exceptional tack and grip, the Wilson® NFL® Performance Official Football features ACL white pebbled composite laces to increase grip by 174% and provide outstanding ball control. The Wilson® NFL® Performance Official Football also features Performance Composite construction for confidence while catching, throwing and running. A butyl rubber bladder offers maximim air retention. FEATURES: Official size football Performance Composite construction for excellent grip and ball control Butyl rubber bladder provides maximum air retention ACL white pebbled composite laces increase grip by 174% Preferred by quarterbacks Model: WTF1794ID Wilson|Wilson NFL Performance Official Football|24.99|1'),
(87, 20, 1, 'test18|None|Tumi Rivington Double Billfold|Casual and textural, the Rivington collection combines natural grain leather with smooth leather trim details. This wallet has a double bill compartment, eight card slots and two pockets. Comes in an elegant gift box.|Tumi Rivington Double Billfold|90|1'),
(88, 21, 1, 'test19|None|Moleskine Livescribe Notebook|The Livescribe Notebook by Moleskine #1 is an elegantly designed blank space that brings thoughts and ideas straight to your device as you write on its pages. Using the Bluetooth technology of the Livescribe 3 Smartpen and dot paper, its content instantly appears in the app in real time. The notebook features the iconic Moleskine design details, from the familiar rounded corners, ivory-coloured pages and ribbon bookmark to the elastic closure and “in case of loss…” label printed on the flyleaf. Its center-stitched binding ensures the notebook lies flat, for an enjoyable writing experience. The on-page commands which enable quick access to the app’s features, including voice recognition, have also been redesigned in the Moleskine style. Two bookmarks are stored in the back pocket with further commands for the Livescribe smartpen. Lastly, the debossed pattern on the cover subtly recalls the design of the smartpen, a perfect finish for this innovative tool that bridges analog and digital.* The Moleskine Livescribe Notebooks are available in #1 and #2 and work with all Livescribe smartpens.|Moleskine Livescribe Notebook|29.95|1'),
(85, 18, 1, 'test16|None|Space Bar Monitor Stand|Space Bar is a sleek desk accessory that minimizes clutter while providing additional USB ports for your computer. After a long day of work, slide your keyboard into the space below the shelf and store your office miscellany—keys, digital camera, etc.—up top.|Space Bar Monitor Stand|99.99|1'),
(86, 19, 1, 'test17|None|Greenies Daily Dental Dog Treat|GREENIES Veterinary Formula Canine Dental Chews contain our most powerful teeth-cleaning formula ever. Dogs'' teeth sink far into the grooves and valleys to scrub away plaque and tartar, freshen breath and promote healthier gums by up to 80%.* Dental Chews feature a blend of highly soluble proteins, vitamins, Omega-3 fatty acids, antioxidants and chelated minerals. They''re high in protein, low in fat and nutritionally complete for adult dogs. Food Type: Dog Treat Life Stage: Adult Health Consideration: Dental Care Flavor: Other Primary Ingredient: Gelatin Calories Per Serving: 26 calories per treat Package Weight: 36 oz Directions: Feed 1 Greenies per day. Not suitable for dogs less than 5 lbs or dogs less than 6 months of age. Fresh drinking water should always be available. Ingredients: Gelatin, Wheat Protein Isolate, Glycerin, Pea Protein, Water, Potato Protein, Sodium Caseinate, Fish Oil, Minerals (Dicalcium Phosphate, Calcium Carbonate, Potassium Chloride, Magnesium Amino Acid Chelate, Zinc Amino Acid Complex, Iron Amino Acid Complex, Copper Amino Acid Complex, Manganese Amino Acid Complex, Potassium Iodide), Vitamins (Dl-Alpha Tocopherol Acetate [Source of Vitamin E], L-Ascorbyl-2-Polyphosphate [Source of Vitamin C], Vitamin B12 Supplement, D-Calcium Pantothenate [Vitamin B5], Niacin Supplement, Vitamin A Supplement, Riboflavin Supplement, Vitamin D3 Supplement, Biotin, Pyridoxine Hydrochloride [Vitamin B6], Thiamine Mononitrate [Vitamin B1], Folic Acid), Natural Poultry Flavor, Lecithin, Dried Tomato, Apple Pomace, Dried Cultured Skim Milk, Ground Flaxseed, Dl-Methionine, Dried Sweet Potato, Cranberry Fiber, Choline Chloride, Taurine, Decaffeinated Green Tea Extract, Carotene, Chlorophyll (Sodium Copper Chlorophyllin) Guaranteed Analysis: Crude Protein (min) 50.0% Crude Fat (min) 5.0% Crude Fiber (max) 2.0% Moisture (max) 15.0% Iron (min) 150 mg/kg Zinc (min) 150 mg/kg Vitamin A (min) 6,000 IU/kg Vitamin E (min) 650 IU/kg Docosahexaenoic Acid (DHA) (min) 0.16%* Eicosapentaenoic Acid (EPA) (min) 0.13%* *Not recognized as an essential nutrient by the AAFCO Dog Food Nutrient Profiles.|Greenies Daily Dental Dog Treat|30|1'),
(82, 15, 1, 'test13|None|Kids Earmuffs|fabric & care 100% Man Made Materials Machine wash. Imported. overview Faux fur ear detailing. Padded throughout for extra comfort. Velvet covered band.|Gap Kids Earmuffs|14.95|1'),
(83, 16, 1, 'test14|None|Lego Batman Man-Bat Attack|Take part in Man-Bat Attack as Nightwing is ambushed by the hideous Man-Bat and the Batcopter swoops in, armed with fearsome flick missiles!|Lego Batman Man-Bat Attack|19.99|1'),
(84, 17, 1, 'test15|None|Cuisinart Coffee On Demand Coffee Maker|A marvel for everyday sipping and casual entertaining, this sophisticated and compact coffeemaker makes up to 12 cups of coffee and dispenses one hot cup at a time – just press the lever. Coffee is brewed directly into an insulated thermal reservoir that holds up to 12 cups (60 oz.) and keeps coffee hot for up to four hours. Fully automatic with 24-hour advance programming. Optional one- to four-cup brewing cycle. Easy-to-read gauge and visible water-level indicator. Showerhead evenly distributes water over grounds, reducing temperature loss. Charcoal water filter removes impurities and ensures fresh-tasting coffee. Gold-tone coffee filter eliminates the need for paper filters. Audible alert signals brewing is complete. Automatic shutoff is programmable up to four hours. Coffee reservoir and drip tray remove for easy cleanup. ABS plastic housing with stainless-steel exterior. 10" x 8 1/2" x 14 1/2" high, 60-fl.-oz. cap., 9 lb. 8 oz. 1100W. 3-year standard warranty. This product is intended for use in the United States and Canada and is built to United States electrical standards. Made in China.|Cuisinart Coffee On Demand Coffee Maker|99.95|1'),
(80, 13, 1, 'test11|None|Gap Boys Stripe Pocket Tee|fabric & care 100% Cotton Machine wash. Imported. overview Soft slub jersey. Long sleeves. Crewneck. Patch pocket at chest. Allover stripes.|Gap Boys Stripe Pocket Tee|16.95|1'),
(81, 14, 1, 'test12|None|Girls Gap Hi-Top Sneakers|fabric & care 100% Man Made Materials Spot clean. Imported. overview Canvas outer. Rounded toe. Lace-up placket. Easy pull-on tab at back. Treaded rubber sole. Please note: Japanese market has additional zip closure.|Girls Gap Hi-Top Sneakers|16.99|1'),
(77, 10, 1, 'test8|None|Nike Free 5.0|The Nike Free 5.0 Men''s Running Shoe combines a highly flexible, low-profile outsole for natural movement and the cushioning, traction and lightweight support of a traditional running shoe.|Nike Free 5.0|74.97|1'),
(78, 11, 1, 'test9|None|Tiger Woods Mesh Hat|The TW Tour Mesh Golf Hat features a stretch-to-fit design and authentic 20XI tour detail for a snug, customizable fit and style inspired by a legendary champion.|Nike Tiger Woods Mesh hat|30|1'),
(79, 12, 1, 'test10|None|Gillette Fusion Cartridges|Product Description: Gillette Fusion® is a revolutionary shaving system with advanced technology on both the front and the back of a single shaving cartridge. 5-Blade Shaving Surface Technology with 5 Blades spaced closer together to help reduce pressure-with more comfort and less irritation than MACH3 Precision Trimmer on the back of the razor for those tricky spots like sideburns, under the nose and around facial hair Flexible Comfort Guard for a comfortably close shave Enhanced Indicator® Lubricating Strip gradually fades to white when you are no longer getting your optimal shave.|Gillette Fusion Cartridges|27|1'),
(76, 9, 1, 'test7|None|Urban Decay Naked3 Eyeshadow|What it is: A mirrored compact packed with a dozen never-before-seen rose-hued neutrals, plus a double-ended brush and an Eyeshadow Primer Potion sampler. What it does: Dare to get Naked all over again with Urban Decay’s latest shadow palette. Naked3 debuts 12 insanely beautiful rose-hued neutrals in an impressive range of shades—from pale, shimmery pink to deep black matte with red microglitter—in ultrasmooth matte, pearl, and glimmering metallic finishes. Each shadow features Urban Decay’s Pigment Infusion System™, the proprietary blend of ingredients that gives every shade its velvety texture, rich color, serious staying power, and blendability. This set contains: - 0.05 oz x 12 Eyeshadows in Strange (pale neutral pink matte-satin), Dust (pale metallic pink shimmer w/iridescent micro-glitter), Burnout (light pinky-peach satin), Limit (light dusty rose matte), Buzz (metallic rose shimmer w/silver microglitter), Trick (light metallic pinky-copper shimmer w/tonal microsparkle), Nooner (medium pinky-brown matte), Liar (medium metallic mauve shimmer), Factory (pinky-brown satin), Mugshot (metallic taupe shimmer w/slight pink shift), Darkside (deep taupe-mauve satin), Blackheart (smoky black matte w/rosy red microsparkle) - Double-ended brush - 4 x 0.025 oz Eyeshadow Primer Potion sample packettes What it is formulated WITHOUT: - Parabens - Sulfates - Phthalates What else you need to know: The gorgeous rose-gold art-school-inspired tin case hints at the shades inside. Embossed on top with a big “Naked3” and cool facets that beg to be touched, this case is sure to inspire lots of jealous stares. Naked3 also includes a new double-ended shadow/blending brush and an Eyeshadow Primer Potion sampler with resealable samples of all four formulas (Original, Sin, Eden, and Anti-Aging). Each sample holds about a week’s worth of Primer. Years ago, Wende (founding partner of Urban Decay) had a boyfriend who took the most amazing pictures of her at sunset, when the light was ridiculously flattering. With Naked3, she wanted to recreate that amazing “golden hour” vibe that looks great on everyone. The eye shadows in this palette coordinate with the 24/7 Glide-On Double-Ended Eye Pencil: Darkside (purple-taupe satin)/Blackheart (smoky black matte with rosy red microglitter).|Urban Decay Naked3 Eyeshadow|54|1'),
(97, 28, 1, 'deal2|Taxable Goods|beads jewlerry|beads jewlerry|beads jewlerry|99.99|1'),
(95, 27, 1, 'deal1|Taxable Goods|adventure man collection|adventure man collection|adventure man collection|99.99|1'),
(72, 5, 1, 'test3|None|Post Practice Polo|why we made this: We designed this soft polo shirt to pull on after a sweat session and keep us comfortable all day. The structured collar holds its shape even if we''re still a little sweaty as we leave the gym and the soft, breathable Vitasea™ fabric helps us feel cool after a hard workout. fabric + features: lightweight, breathable Vitasea fabric feels super soft against your skin the natural fabric has four-way stretch with great shape retention so it won''t bag out hidden buttons help keep your collar down designed not to shrink so laundry day is easy imported fit + function: designed for: to-and-from fabric(s): Vitasea™ fit: athletic length: hip|Post Practice Polo from Lululemon|78|1'),
(74, 7, 1, 'test6|None|Thin Enamel Flip Flop|Our Thin Enamel Flip-Flop is the perfect off-duty wardrobe essential for the beach and beyond. Finished with an enamel and gold logo for a touch of polish, it’s a warm-weather staple and a great extra pair to throw in your gym bag or summer getaway carryall.|Tory Burch Thin Enamel Flip Flop|50|1'),
(75, 8, 1, 'test 5|None|Logo Checkerboard Phone Case|It''s time to let your phone do the talking. Stamped with our logo checkerboard print, this signature phone case turns your favorite gadget into its own standout accessory. Sending texts, snapping pics and making phone calls has never looked so good.|Michael Kors Logo Checkerboard Phone Case|38|1'),
(73, 6, 1, 'test4|None|Wunder Under Pant|why we made this: We created these pants to be a no-fuss tight for our yoga practice, but we just couldn''t stop wearing them. Made of our signature four-way stretch Luon® fabric with a second-skin fit, they give us room to move and sweat from backbends to box jumps. fabric + features: cottony-soft Luon fabric is engineered for serious stretch and recovery Luon fabric is sweat-wicking, four-way stretch and breathable second-skin fit is great for checking your alignment in the mirror the wide, smooth waistband is designed to eliminate muffin top stow your yoga pass or gym card in our signature waistband pocket imported fit + function: designed for: yoga, gym, to-and-from fabric(s): Luon® fit: tight rise: medium inseam: 301/2" leg opening: 11" hemmable: yes|Lululemon Wunder Under Pant|82|1'),
