(14, 4, 72, 0, 5, 'why we made this:\r\nWe designed this soft polo shirt to pull on after a sweat session and keep us comfortable all day. The structured collar holds its shape even if we''re still a little sweaty as we leave the gym and the soft, breathable Vitasea™ fabric helps us feel cool after a hard workout.\r\n\r\nfabric + features:\r\nlightweight, breathable Vitasea fabric feels super soft against your skin\r\nthe natural fabric has four-way stretch with great shape retention so it won''t bag out\r\nhidden buttons help keep your collar down\r\ndesigned not to shrink so laundry day is easy\r\nimported\r\n\r\nfit + function:\r\ndesigned for: to-and-from\r\nfabric(s): Vitasea™\r\nfit: athletic\r\nlength: hip'),
(15, 4, 73, 0, 5, 'Post Practice Polo from Lululemon'),
(16, 4, 83, 0, 5, NULL),
(17, 4, 106, 0, 5, NULL),
(22, 4, 72, 0, 6, 'why we made this:\r\nWe created these pants to be a no-fuss tight for our yoga practice, but we just couldn''t stop wearing them. Made of our signature four-way stretch Luon® fabric with a second-skin fit, they give us room to move and sweat from backbends to box jumps.\r\n\r\nfabric + features:\r\ncottony-soft Luon fabric is engineered for serious stretch and recovery\r\nLuon fabric is sweat-wicking, four-way stretch and breathable\r\nsecond-skin fit is great for checking your alignment in the mirror\r\nthe wide, smooth waistband is designed to eliminate muffin top\r\nstow your yoga pass or gym card in our signature waistband pocket\r\nimported\r\n\r\nfit + function:\r\ndesigned for: yoga, gym, to-and-from\r\nfabric(s): Luon®\r\nfit: tight\r\nrise: medium\r\ninseam: 301/2"\r\nleg opening: 11"\r\nhemmable: yes'),
(23, 4, 73, 0, 6, 'Lululemon Wunder Under Pant'),
(24, 4, 83, 0, 6, NULL),
(25, 4, 106, 0, 6, NULL),
(32, 4, 72, 0, 7, 'Our Thin Enamel Flip-Flop is the perfect off-duty wardrobe essential for the beach and beyond. Finished with an enamel and gold logo for a touch of polish, it’s a warm-weather staple and a great extra pair to throw in your gym bag or summer getaway carryall.'),
