(121, 4, 72, 0, 17, 'A marvel for everyday sipping and casual entertaining, this sophisticated and compact coffeemaker makes up to 12 cups of coffee and dispenses one hot cup at a time – just press the lever.\r\nCoffee is brewed directly into an insulated thermal reservoir that holds up to 12 cups (60 oz.) and keeps coffee hot for up to four hours.\r\nFully automatic with 24-hour advance programming.\r\nOptional one- to four-cup brewing cycle.\r\nEasy-to-read gauge and visible water-level indicator.\r\nShowerhead evenly distributes water over grounds, reducing temperature loss.\r\nCharcoal water filter removes impurities and ensures fresh-tasting coffee.\r\nGold-tone coffee filter eliminates the need for paper filters.\r\nAudible alert signals brewing is complete.\r\nAutomatic shutoff is programmable up to four hours.\r\nCoffee reservoir and drip tray remove for easy cleanup.\r\nABS plastic housing with stainless-steel exterior.\r\n10" x 8 1/2" x 14 1/2" high, 60-fl.-oz. cap., 9 lb. 8 oz.\r\n1100W.\r\n3-year standard warranty.\r\nThis product is intended for use in the United States and Canada and is built to United States electrical standards.\r\nMade in China.'),
