(131, 4, 72, 0, 18, 'Space Bar is a sleek desk accessory that minimizes clutter while providing additional USB ports for your computer. After a long day of work, slide your keyboard into the space below the shelf and store your office miscellany—keys, digital camera, etc.—up top.'),
