(139, 4, 72, 0, 19, 'GREENIES Veterinary Formula Canine Dental Chews contain our most powerful teeth-cleaning formula ever. Dogs'' teeth sink far into the grooves and valleys to scrub away plaque and tartar, freshen breath and promote healthier gums by up to 80%.* Dental Chews feature a blend of highly soluble proteins, vitamins, Omega-3 fatty acids, antioxidants and chelated minerals. They''re high in protein, low in fat and nutritionally complete for adult dogs.\r\n\r\nFood Type: Dog Treat \r\nLife Stage: Adult \r\nHealth Consideration: Dental Care \r\nFlavor: Other \r\nPrimary Ingredient: Gelatin \r\nCalories Per Serving: 26 calories per treat \r\nPackage Weight: 36 oz\r\n\r\nDirections: \r\nFeed 1 Greenies per day. \r\nNot suitable for dogs less than 5 lbs or dogs less than 6 months of age. \r\nFresh drinking water should always be available.\r\n\r\nIngredients:\r\nGelatin, Wheat Protein Isolate, Glycerin, Pea Protein, Water, Potato Protein, Sodium Caseinate, Fish Oil, Minerals (Dicalcium Phosphate, Calcium Carbonate, Potassium Chloride, Magnesium Amino Acid Chelate, Zinc Amino Acid Complex, Iron Amino Acid Complex, Copper Amino Acid Complex, Manganese Amino Acid Complex, Potassium Iodide), Vitamins (Dl-Alpha Tocopherol Acetate [Source of Vitamin E], L-Ascorbyl-2-Polyphosphate [Source of Vitamin C], Vitamin B12 Supplement, D-Calcium Pantothenate [Vitamin B5], Niacin Supplement, Vitamin A Supplement, Riboflavin Supplement, Vitamin D3 Supplement, Biotin, Pyridoxine Hydrochloride [Vitamin B6], Thiamine Mononitrate [Vitamin B1], Folic Acid), Natural Poultry Flavor, Lecithin, Dried Tomato, Apple Pomace, Dried Cultured Skim Milk, Ground Flaxseed, Dl-Methionine, Dried Sweet Potato, Cranberry Fiber, Choline Chloride, Taurine, Decaffeinated Green Tea Extract, Carotene, Chlorophyll (Sodium Copper Chlorophyllin)\r\n\r\nGuaranteed Analysis: \r\nCrude Protein (min) 50.0% \r\nCrude Fat (min) 5.0% \r\nCrude Fiber (max) 2.0% \r\nMoisture (max) 15.0% \r\nIron (min) 150 mg/kg \r\nZinc (min) 150 mg/kg \r\nVitamin A (min) 6,000 IU/kg \r\nVitamin E (min) 650 IU/kg \r\nDocosahexaenoic Acid (DHA) (min) 0.16%* \r\nEicosapentaenoic Acid (EPA) (min) 0.13%*\r\n\r\n*Not recognized as an essential nutrient by the AAFCO Dog Food Nutrient Profiles.'),
(140, 4, 73, 0, 19, 'Greenies Daily Dental Dog Treat'),
