(157, 4, 72, 0, 21, 'The Livescribe Notebook by Moleskine #1 is an elegantly designed blank space that brings thoughts and ideas straight to your device as you write on its pages. Using the Bluetooth technology of the Livescribe 3 Smartpen and dot paper, its content instantly appears in the app in real time. \r\n\r\nThe notebook features the iconic Moleskine design details, from the familiar rounded corners, ivory-coloured pages and ribbon bookmark to the elastic closure and “in case of loss…” label printed on the flyleaf. Its center-stitched binding ensures the notebook lies flat, for an enjoyable writing experience. The on-page commands which enable quick access to the app’s features, including voice recognition, have also been redesigned in the Moleskine style. Two bookmarks are stored in the back pocket with further commands for the Livescribe smartpen. Lastly, the debossed pattern on the cover subtly recalls the design of the smartpen, a perfect finish for this innovative tool that bridges analog and digital.* \r\n\r\nThe Moleskine Livescribe Notebooks are available in #1 and #2 and work with all Livescribe smartpens. '),
(158, 4, 73, 0, 21, 'Moleskine Livescribe Notebook'),
(159, 4, 83, 0, 21, NULL),
(160, 4, 106, 0, 21, NULL),
(165, 4, 72, 0, 22, 'Preferred by quarterbacks for its exceptional tack and grip, the Wilson® NFL® Performance Official Football features ACL white pebbled composite laces to increase grip by 174% and provide outstanding ball control. The Wilson® NFL® Performance Official Football also features Performance Composite construction for confidence while catching, throwing and running. A butyl rubber bladder offers maximim air retention. \r\n\r\nFEATURES:\r\n\r\nOfficial size football\r\nPerformance Composite construction for excellent grip and ball control\r\nButyl rubber bladder provides maximum air retention\r\nACL white pebbled composite laces increase grip by 174%\r\nPreferred by quarterbacks\r\nModel: WTF1794ID\r\nWilson'),
